def plot_confusion_matrix(y,y_predict):
  #This line defines a function named plot_confusion_matrix that accepts two arguments:
#y: This represents the true labels of the data.
#y_predict: This represents the predicted labels generated by your model.
    "this function plots the confusion matrix"
