    #These lines (assuming 'did not land' and 'land' are your class labels) customize the tick labels on the x and y-axes to make the plot more readable in your specific context.
    ax.set_title('Confusion Matrix'); #This line sets the label for the y-axis, indicating the true labels.
    ax.xaxis.set_ticklabels(['did not land', 'land']); ax.yaxis.set_ticklabels(['did not land', 'landed'])
    plt.show()  #This line displays the generated confusion matrix plot.
